pragma solidity ^0.5.0;

contract MyContract{
    uint public balance;
    address public owner;
constructor() public {
    owner = msg.sender;
}

    function getMoney() public payable{
        if(owner!= msg.sender)
        {
            revert ("Uare not the owner");
        }
        balance += msg.value;//msg is mesage object it contains who sent ,to whom sent 
    }

    function withdrawMoney(address payable to,uint amt) public {
        require(owner ==msg.sender,"U r not owner");
        assert(amt <= balance);
        balance-=amt;
        to.transfer(amt);//to will send money to the person amt
    } 
}
